import React from 'react';

class InputComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = { phone: ''};
  }

  render() {
    return (
      <>
        <input 
        className = {this.props.className}
        type={this.props.type}
        name={this.props.name}
        />
      </>
    );
  }
}

export default InputComponent;
